import { Component, OnInit } from '@angular/core';
import { SSOLoginDataModel } from '../../Models/SSOLoginDataModel';
import { PlacementDashService } from '../../Services/PlacementDashboard/PlacementDash.service';
import { ToastrService } from 'ngx-toastr';
import { LoaderService } from '../../Services/Loader/loader.service';
import { FormBuilder } from '@angular/forms';
import { ActivatedRoute, Router } from '@angular/router';
import { NgbModal } from '@ng-bootstrap/ng-bootstrap';
import { PlacementStudentSearchModel } from '../../Models/PlacementStudentSearchModel';
import { PlacementReportSearchModels } from '../../Models/PlacementDashReportModel';
import { PlacementReportService } from '../../Services/PlacementReport/PlacementReport.service';

@Component({
  selector: 'app-placement-dash-report',
  templateUrl: './placement-dash-report.component.html',
  styleUrls: ['./placement-dash-report.component.css']
})
export class PlacementDashReportComponent implements OnInit {
  public ReportDataList: any = [];
  public Table_SearchText: string = "";
  /*  public searchRequest = new CommonSubjectMasterSearchModel();*/
  public sSOLoginDataModel = new SSOLoginDataModel();
  public State: number = 0;
  public Message: string = '';
  public ErrorMessage: string = '';
  public search = new PlacementReportSearchModels()
  public Id: any | null = null;
  constructor(private PlacementDashService: PlacementReportService, private toastr: ToastrService, private loaderService: LoaderService, private formBuilder: FormBuilder, private activatedRoute: ActivatedRoute, private routers: Router, private modalService: NgbModal) {

  }

  async ngOnInit() {
    this.Id = (this.activatedRoute.snapshot.paramMap.get('id')?.toString())?.split('=')[1];

    console.log(this.Id)
    this.sSOLoginDataModel = await JSON.parse(String(localStorage.getItem('SSOLoginUser')));
    await this.GetAllData()
  }

  async GetAllData() {
    try {
      this.loaderService.requestStarted();
      if (this.Id > 0) {
        this.search.Id = this.Id
      }
      await this.PlacementDashService.GetAllData(this.search)
        .then((data: any) => {
          data = JSON.parse(JSON.stringify(data));

          this.ReportDataList = data['Data'];
          console.log(this.ReportDataList)
         /* console.log(this.viewPlacementDashboardList);*/
        }, (error: any) => console.error(error)
        );
    }
    catch (ex) {
      console.log(ex);
    }
    finally {
      setTimeout(() => {
        this.loaderService.requestEnded();
      }, 200);
    }
  }

  async ClearSearchData() {
    this.search.StudentName = '';
    this.search.Gender = '';
  
    await this.GetAllData();
  }

}
