<div class="flex items-center justify-between flex-wrap gap-2 mb-6">
  <div>
    <h4 class="text-slate-900 text-lg font-medium mb-2">Placement Dash Report</h4>

    <div class="md:flex hidden items-center gap-3 text-sm font-semibold">
      <a href="#" class="text-sm font-medium text-slate-700">DashBoard</a>
      <i class="material-symbols-rounded text-xl flex-shrink-0 text-slate-500">chevron_right</i>
      <a href="Branches.html" class="text-sm font-medium text-slate-700" aria-current="page">Placement Dash Report</a>
    </div>
  </div>
</div>


<div class="card">
  <div class="card-body p-5">
    <div class="mb-8">
      <div class="flex justify-between flex-wrap items-center mb-3 p-3 py-2 bg-light">
        <b class="text-1xl-5"><i class="ti ti-search"></i> Enter Search Criteria</b>
      
      </div>
      <div class="grid 2xl:grid-cols-4 xl:grid-cols-4 lg:grid-cols-3 md:grid-cols-2 grid-cols-1 gap-3">
        <div>
          <label class="text-gray-800 text-sm font-medium inline-block mb-1">Student Name</label>
          <input type="text" class="form-input" placeholder="Search By Student Name" [(ngModel)]="search.StudentName" >
        </div>
      

        <div>
          <label class="text-gray-800 text-sm font-medium inline-block mb-1">Gender</label>
          <select class="form-select" id="SearchId" [(ngModel)]="search.Gender" >
            <option value="">Choose Option</option>
            <option value="Male">Male</option>
            <option value="Female">Female</option>
          </select>
        </div>



        <div>
          <button type="button" class="btn bg-info text-white mt-6" (click)="GetAllData()">Search</button>
          <button type="button" class="btn bg-danger text-white mt-6" (click)="ClearSearchData()"><i class="ti ti-refresh"></i> Reset</button>
        </div>

      </div>


    </div>
    <div class="flex justify-between flex-wrap items-center mb-3 p-3 py-2 bg-light">
      <b class="text-1xl-5"><i class="ti ti-list"></i> Search Results</b>
    </div>
    <div class="grid 2xl:grid-cols-4 xl:grid-cols-4 lg:grid-cols-3 md:grid-cols-2 grid-cols-1 gap-3">
      <div class="">
        <select id="ddlConter" class="form-select  couterDropDown">
          <option value="50">50</option>
          <option value="100">100</option>
          <option value="500">500</option>
          <option value="1000">1000</option>
        </select>
      </div>
      <div class="">
      </div>
      <div class="">
      </div>
      <div class="">
        <input class="form-input" placeholder="Search..." [(ngModel)]="Table_SearchText"/>
      </div>
    </div>
    <div class="overflow-x-auto mt-3">
      <table class="table table-border w-full table-auto" cellpadding="5">
        <thead class="bg-light/40 border-b border-gray-100 dark:bg-light/5 dark:border-b-gray-700 h-10">
          <tr>
            <th width="80px" align="left">Sr. No.</th>
            <th class="text-left">Student Name</th>
            <th class="text-left">Enrollment No</th>
            <th class="text-left">Institute Name</th>
            <th class="text-left">Institute Managment</th>
            <th class="text-center">Email</th>
            <th class="text-left">Father Name</th>
            <th class="text-left">DOB</th>
            <th class="text-left">Age</th>
            <th class="text-left">Gender</th>
            <th class="text-left">Mobile No</th>
  
            


          </tr>
        </thead>
        <tbody>

          <tr *ngFor="let row of ReportDataList | tableSearchFilter:Table_SearchText;let idx=index;">
            <td>{{idx+1}}</td>
            <td class="lg:whitespace-nowrap py-4 pl-4 pr-3 text-sm sm:pl-6">{{row.StudentName}}</td>
            <td class="lg:whitespace-nowrap py-4 pl-4 pr-3 text-sm sm:pl-6">{{row.EnrollmentNo}}</td>
            <td class="lg:whitespace-nowrap py-4 pl-4 pr-3 text-sm sm:pl-6">{{row.InstituteName}}</td>
              
                  <td class="lg:whitespace-nowrap py-4 pl-4 pr-3 text-sm sm:pl-6">{{row.InstitutionManagementType}}</td>
                  <td class="lg:whitespace-nowrap py-4 pl-4 pr-3 text-sm sm:pl-6 text-center">{{row.Email}}</td>
                  <td class="lg:whitespace-nowrap py-4 pl-4 pr-3 text-sm sm:pl-6">{{row.FatherName}}</td>
                  <td class="lg:whitespace-nowrap py-4 pl-4 pr-3 text-sm sm:pl-6">{{row.DOB}}</td>
                  <td class="lg:whitespace-nowrap py-4 pl-4 pr-3 text-sm sm:pl-6">{{row.Age}}</td>
                  <td class="lg:whitespace-nowrap py-4 pl-4 pr-3 text-sm sm:pl-6">{{row.Dis_Gender}}</td>
                  <td class="lg:whitespace-nowrap py-4 pl-4 pr-3 text-sm sm:pl-6">{{row.MobileNo}}  
                    
                  </td>

          </tr>

        </tbody>
